  false,\n\t\"url\": null,\n\t\"notes\": \"This report contains ground-water data
  collected at wells and springs on the Bonneville Salt Flats an in Pilot Valley,
  western Utah. Most of the data were collected during a study of the hyrology and
  surface morphology of these two salt-crust areas during the period July 1975 - June
  1977. The study was carried out in cooperation with the U.S. Bureau of Land management.
